import { Question } from "./components/Question.js";
import { QuestionNavbar } from "../QuestionNavbar.js";

export const Study21 = () => {
  return (
    <div className="questions">
      <QuestionNavbar />
      <Question
        title={
          "Miksi et halua tehdä juttua polarisoivasta aiheesta? Minkälaista apua kaipaat polarisoivan aiheen käsittelyyn?​​​​​​"
        }
        options={[
          { value: "Yleisön reaktio pelottaa. Kaipaan tukea palautevyöryn käsittelemisessä.​​​​", navigate: "study/23" },
          { value: "Kaipaan tukea ja ohjeistusta moniäänisempien juttujen tekemiseen.​​​​​", navigate: "study/24" },
          { value: "Kaipaan lisää aikaa ja muita resursseja polarisoivan aiheen käsittelyyn.​​​​​", navigate: "study/25" },
          { value: "On haastavaa löytää monipuolisia ja moniäänisiä uskottavia lähteitä.​​​​​", navigate: "study/22" },
          { value: "Pelkään, että uskottavuuteni kärsii, jos tuon esiin valtavirrasta poikkeavia näkökulmia esiin.​​​​​", navigate: "study/26" },
        ]}
      />
    </div>
  );
};
